</plugin>"



mkdir -p "$working_dir/classes"

echo -n "$container_4_7_5_zip_b64" | base64 -d > "$working_dir/container.zip"
unzip -o -qq "$working_dir/container.zip" -d "$working_dir/"

echo -n "$java_code" > "$working_dir/$class_name.java"
echo -n "$plugin_xml" > "$working_dir/plugin.xml"

cd "$working_dir"

if [ "${print_java_code:-}" == "true" ]; then
